from typing import List

def find_max_height(A: List[int], M: int) -> int:

    def check(mid: int, arr: List[int], M: int) -> bool:
        wood_cut = 0
        for ele in arr:
            wood_cut += max(0, ele - mid)
            if wood_cut >= M:
                return True
        return False
    (mn, mx) = (0, max(A))
    while mn < mx:
        mid = (mn + mx) // 2
        if check(mid, A, M):
            mn = mid + 1
        else:
            mx = mid - 1
    return mx

